// Assuming:
//   srcAddy = The address you are checking to see of it's in range of the CIDR - i.e. 2456:2346:6631:7345:7335:8245:8344:2345
//   tgtAddy = The CIDR source address which identifies network range - i.e. ::acbd:1234
//   tgtBits = The number of bits in the CIDR mask - i.e. /120
function isIpvSixAddressInCidr(srcAddy, tgtAddy, tgtBits) {
	if (tgtBits < 0 || tgtBits > 128) return false; // Invalid number of bits in CIDR mask
	var srcParts = parseIpvSixAddressToIntArray(srcAddy); // Array of 8 ints - converts hex IPv6 addy
	var tgtParts = parseIpvSixAddressToIntArray(tgtAddy); // Array of 8 ints - converts hex IPv6 addy
	if (srcParts.length != 8 || tgtParts.length != 8) return false; // Bad parsing
	for (var i=0; i<tgtBits; i++) {
		var curShift = 15 - (i % 16); // Determine current iteration bit location to test
		var curMask  = 1 << curShift; // Shift mask up by curShift bits
		var curIndex = Math.floor(i / 16); // Determine which integer we're investigating
		if ( srcParts[curIndex] & curMask !== tgtParts[curIndex] & curMask ) return false; // Compare bits - no match = not in range
	}
	return true; // Everything passed so it must be good
}

function parseIpvSixAddressToIntArray(ipvSixText) {
	var trimmed  = ipvSixText.trim();
	var retArray = [0,0,0,0,0,0,0,0]; // Set defaults to work from
	if (trimmed === '::') return retArray;
	if (/::/.test(trimmed)) { // Truncated address means special treatment
		var parts = trimmed.split(':');
		if (/^::/.test(trimmed)) { // Address starts with wildcard so fill from back to front
			for (var i = parts.length - 1, curIndex = 7; i > 0; i--, curIndex--) {
				if (parts[i]) retArray[curIndex] = parseInt(parts[i], 16);
			}
		} else if (/::$/.test(trimmed)) { // Address ends with wildcard so fill from front to back
			for (var i = 0, curIndex = 0; i < parts.length; i++, curIndex++) {
				if (parts[i]) retArray[curIndex] = parseInt(parts[i], 16);
			}
		} else { // Wildcard was in the middle, so go front to back until wildcard hit, then back to front to fill other side
			for (var i = 0, curIndex = 0; i < parts.length; i++, curIndex++) {
				if (parts[i] === '') break;
				if (parts[i]) retArray[curIndex] = parseInt(parts[i], 16);
			}
			for (var i = parts.length - 1, curIndex = 7; i > 0; i--, curIndex--) {
				if (parts[i] === '') break;
				if (parts[i]) retArray[curIndex] = parseInt(parts[i], 16);
			}
		}
	} else { // Non-truncated address means easy peasy
		var parts = trimmed.split(':');
		if (parts.length !== 8) return [0];
		var retArray = [];
		for (index in parts) retArray[index] = parseInt(parts[index], 16);
	}
	return retArray;
}
